import React, {useState} from 'react';

import { StyleSheet, Text, View, FlatList, Image, TouchableOpacity } from 'react-native';

const styles = StyleSheet.create({
  images: {
  	marginLeft:10,
  	alignItems: 'center',
  	justifyContent: 'center',
    resizeMode: 'contain',
}});


function KatsItem ({item, navigation, id}) {


	return (
	<View style={{
			flex: 1,
			flexDirection: 'row',
			backgroundColor: 'white',
			height: 'auto',
	        borderRadius: 16,
	        margin: 10,
	        shadowColor: "#000",
			shadowOffset: {
			width: 0,
			height: 2,
			},
			shadowOpacity: 2.29,
			shadowRadius: 3.65,
	      }}
	      >
	      <TouchableOpacity onPress={() => {
	      	navigation.navigate('kats view', {
	      		itemId: item.id
	      	})
	      }}>
			<Image
			style={styles.images}
          	source={{
            width: 150,
            height: 250,
            uri: item.preview
        }}
          />
          </TouchableOpacity>
          <View style={{justifyContent: 'center', paddingLeft: 30, paddingTop: 190}}>
	          <Text style={{fontSize: 40}}>
	          {item.cat}	
	          </Text>
	      </View>	         
		</View>
	)
}

export default KatsItem;
